// ============================================
// GERADOR DE RELATÓRIO DE CHECKLIST EM HTML
// Abre em nova aba com opção de imprimir/compartilhar
// ============================================

const LOGO_BASE64 = ''

export const gerarRelatorioChecklist = async ({ checklist, ordemServico, cliente, colaborador }) => {
  const itens = checklist.itens?.sort((a, b) => a.ordem - b.ordem) || []
  
  // Agrupar itens por categoria
  const categorias = {}
  itens.forEach(item => {
    const cat = item.categoria || 'Geral'
    if (!categorias[cat]) categorias[cat] = []
    categorias[cat].push(item)
  })

  const totalItens = itens.length
  const respondidos = itens.filter(i => i.respondido).length
  const progresso = totalItens > 0 ? Math.round((respondidos / totalItens) * 100) : 0

  const dataFormatada = ordemServico?.data_agendamento 
    ? new Date(ordemServico.data_agendamento + 'T12:00:00').toLocaleDateString('pt-BR')
    : new Date().toLocaleDateString('pt-BR')

  const dataGeracao = new Date().toLocaleDateString('pt-BR', {
    day: '2-digit', month: '2-digit', year: 'numeric',
    hour: '2-digit', minute: '2-digit'
  })

  const renderItem = (item) => {
    let resposta = ''
    
    switch (item.tipo_resposta) {
      case 'checkbox':
        resposta = item.resposta_checkbox 
          ? '<span style="color:#16a34a;font-weight:600">✅ Conforme</span>' 
          : '<span style="color:#dc2626;font-weight:600">❌ Não verificado</span>'
        break
      case 'texto':
        resposta = item.resposta_texto 
          ? `<span>${item.resposta_texto}</span>` 
          : '<span style="color:#9ca3af">Não preenchido</span>'
        break
      case 'numero':
        resposta = item.resposta_numero != null 
          ? `<span>${item.resposta_numero}</span>` 
          : '<span style="color:#9ca3af">—</span>'
        break
      case 'foto':
        if (item.resposta_foto_url) {
          resposta = `<div style="margin-top:8px"><img src="${item.resposta_foto_url}" style="max-width:100%;max-height:300px;border-radius:8px;border:1px solid #e5e7eb" crossorigin="anonymous" /></div>`
        } else {
          resposta = '<span style="color:#9ca3af">📷 Foto não registrada</span>'
        }
        break
      case 'selecao_unica':
        resposta = item.resposta_texto 
          ? `<span style="background:#eff6ff;padding:2px 8px;border-radius:4px;color:#1d4ed8">${item.resposta_texto}</span>` 
          : '<span style="color:#9ca3af">Não selecionado</span>'
        break
      case 'selecao_multipla':
        if (item.resposta_selecao_multipla?.length) {
          resposta = item.resposta_selecao_multipla.map(s => 
            `<span style="background:#eff6ff;padding:2px 8px;border-radius:4px;color:#1d4ed8;margin-right:4px;display:inline-block;margin-bottom:2px">${s}</span>`
          ).join('')
        } else {
          resposta = '<span style="color:#9ca3af">Nenhum selecionado</span>'
        }
        break
      case 'data':
        resposta = item.resposta_data 
          ? `<span>${new Date(item.resposta_data + 'T12:00:00').toLocaleDateString('pt-BR')}</span>` 
          : '<span style="color:#9ca3af">—</span>'
        break
      case 'hora':
        resposta = item.resposta_hora 
          ? `<span>${item.resposta_hora}</span>` 
          : '<span style="color:#9ca3af">—</span>'
        break
      case 'assinatura':
        if (item.resposta_assinatura_url) {
          resposta = `<div style="margin-top:8px"><img src="${item.resposta_assinatura_url}" style="max-width:300px;max-height:120px;border:1px solid #e5e7eb;border-radius:4px" crossorigin="anonymous" /></div>`
        } else {
          resposta = '<span style="color:#9ca3af">✍️ Assinatura não registrada</span>'
        }
        break
      default:
        resposta = '<span style="color:#9ca3af">—</span>'
    }

    const obrigatorio = item.obrigatorio ? '<span style="color:#dc2626;margin-left:4px">*</span>' : ''
    const statusIcon = item.respondido ? '✅' : '⬜'

    return `
      <tr>
        <td style="padding:10px 12px;border-bottom:1px solid #f3f4f6;vertical-align:top;width:24px;font-size:14px">${statusIcon}</td>
        <td style="padding:10px 12px;border-bottom:1px solid #f3f4f6;vertical-align:top">
          <div style="font-weight:500;color:#111827;font-size:14px">${item.pergunta}${obrigatorio}</div>
          ${item.descricao ? `<div style="font-size:12px;color:#6b7280;margin-top:2px">${item.descricao}</div>` : ''}
        </td>
        <td style="padding:10px 12px;border-bottom:1px solid #f3f4f6;vertical-align:top;font-size:14px">${resposta}</td>
      </tr>
    `
  }

  const categoriasHTML = Object.entries(categorias).map(([cat, items]) => `
    <div style="margin-bottom:24px">
      <div style="background:#f0fdf4;border-left:4px solid #16a34a;padding:8px 16px;margin-bottom:8px;border-radius:0 8px 8px 0">
        <h3 style="margin:0;font-size:15px;font-weight:600;color:#15803d">${cat}</h3>
      </div>
      <table style="width:100%;border-collapse:collapse">
        <tbody>
          ${items.map(renderItem).join('')}
        </tbody>
      </table>
    </div>
  `).join('')

  const html = `<!DOCTYPE html>
<html lang="pt-BR">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>${checklist.nome} - ${cliente?.nome || 'Relatório'}</title>
  <style>
    * { margin: 0; padding: 0; box-sizing: border-box; }
    body { font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', sans-serif; background: #f9fafb; color: #111827; }
    .container { max-width: 800px; margin: 0 auto; background: white; }
    .no-print { display: flex; gap: 8px; padding: 12px 20px; background: #1e40af; position: sticky; top: 0; z-index: 100; }
    .no-print button { padding: 8px 20px; border-radius: 8px; border: none; font-weight: 600; cursor: pointer; font-size: 14px; }
    .btn-print { background: white; color: #1e40af; }
    .btn-share { background: #22c55e; color: white; }
    .btn-close { background: transparent; color: white; border: 1px solid rgba(255,255,255,0.3) !important; margin-left: auto; }
    @media print {
      .no-print { display: none !important; }
      body { background: white; }
      .container { box-shadow: none; }
      .page-break { page-break-before: always; }
    }
  </style>
</head>
<body>
  <div class="no-print">
    <button class="btn-print" onclick="window.print()">🖨️ Imprimir / Salvar PDF</button>
    <button class="btn-share" id="shareBtn" style="display:none" onclick="compartilhar()">📤 Compartilhar</button>
    <button class="btn-close" onclick="window.close()">✕ Fechar</button>
  </div>

  <div class="container" style="padding:32px">
    <!-- HEADER -->
    <div style="display:flex;align-items:center;justify-content:space-between;margin-bottom:32px;padding-bottom:24px;border-bottom:2px solid #16a34a">
      <div>
        <img src="data:image/jpeg;base64,${LOGO_BASE64}" alt="Logo" style="height:80px;width:auto" />
      </div>
      <div style="text-align:right">
        <h1 style="font-size:20px;color:#15803d;margin-bottom:4px">${checklist.nome}</h1>
        <p style="font-size:13px;color:#6b7280">Tipo: ${checklist.tipo || '-'}</p>
        <p style="font-size:13px;color:#6b7280">Gerado em: ${dataGeracao}</p>
      </div>
    </div>

    <!-- DADOS DA OS -->
    <div style="display:grid;grid-template-columns:1fr 1fr;gap:16px;margin-bottom:28px">
      <div style="background:#f9fafb;padding:16px;border-radius:12px">
        <p style="font-size:12px;color:#6b7280;text-transform:uppercase;font-weight:600;margin-bottom:8px">Dados do Cliente</p>
        <p style="font-size:16px;font-weight:600;color:#111827">${cliente?.nome || '-'}</p>
        <p style="font-size:14px;color:#4b5563;margin-top:4px">📍 ${ordemServico?.endereco || '-'}${ordemServico?.cidade ? ', ' + ordemServico.cidade : ''}</p>
      </div>
      <div style="background:#f9fafb;padding:16px;border-radius:12px">
        <p style="font-size:12px;color:#6b7280;text-transform:uppercase;font-weight:600;margin-bottom:8px">Ordem de Serviço</p>
        <p style="font-size:16px;font-weight:600;color:#111827">${ordemServico?.numero_os || '-'}</p>
        <p style="font-size:14px;color:#4b5563;margin-top:4px">📅 ${dataFormatada}</p>
        ${colaborador ? `<p style="font-size:14px;color:#4b5563;margin-top:2px">👷 ${colaborador}</p>` : ''}
      </div>
    </div>

    <!-- PROGRESSO -->
    <div style="margin-bottom:28px;background:#f0fdf4;padding:16px;border-radius:12px;display:flex;align-items:center;gap:16px">
      <div style="flex:1">
        <p style="font-size:14px;font-weight:600;color:#15803d">Progresso do Checklist</p>
        <div style="margin-top:8px;height:8px;background:#dcfce7;border-radius:4px;overflow:hidden">
          <div style="height:100%;background:#16a34a;border-radius:4px;width:${progresso}%"></div>
        </div>
      </div>
      <div style="text-align:center">
        <p style="font-size:28px;font-weight:700;color:#16a34a">${progresso}%</p>
        <p style="font-size:12px;color:#6b7280">${respondidos}/${totalItens} itens</p>
      </div>
    </div>

    <!-- ITENS POR CATEGORIA -->
    ${categoriasHTML}

    <!-- RODAPÉ -->
    <div style="margin-top:40px;padding-top:20px;border-top:1px solid #e5e7eb;text-align:center">
      <p style="font-size:12px;color:#9ca3af">Passarinho Instalações • Relatório gerado automaticamente pelo sistema de gestão</p>
      <p style="font-size:11px;color:#d1d5db;margin-top:4px">${dataGeracao}</p>
    </div>
  </div>

  <script>
    // Mostrar botão de compartilhar se API disponível
    if (navigator.share) {
      document.getElementById('shareBtn').style.display = 'block'
    }
    
    async function compartilhar() {
      try {
        await navigator.share({
          title: '${checklist.nome} - ${cliente?.nome || "Relatório"}',
          text: 'Relatório de checklist: ${checklist.nome}\\nCliente: ${cliente?.nome || "-"}\\nOS: ${ordemServico?.numero_os || "-"}\\nProgresso: ${progresso}%',
          url: window.location.href
        })
      } catch (err) {
        // Fallback: copiar link
        if (navigator.clipboard) {
          await navigator.clipboard.writeText(window.location.href)
          alert('Link copiado!')
        }
      }
    }
  </script>
</body>
</html>`

  // Abrir em nova aba
  const blob = new Blob([html], { type: 'text/html' })
  const url = URL.createObjectURL(blob)
  window.open(url, '_blank')
  
  return html
}
